          <h1 className="tagline"><div>A BETTER BODY.</div><div>SIMPLIFIED.</div></h1>
          <p>Workout Pal keeps track of your progress so you don't have to.
           Log you workouts with ease by using our comprehensive list of built-in exercises.</p>
          <button><Link to="/home">Get Started</Link></button>
      </div>
    </main>

